import React from 'react'

function WordCard(props) {
  return (
    <div className='wordcard'>
        <h5>Word</h5>
        <h1>{props.word}</h1>
        <p>Meaning</p>
        <h3>{props.meaning}</h3>
    </div>
  )
}

export default WordCard
